--
-- Triggers `users`
--
DELIMITER $$
CREATE TRIGGER `after_user_insert_patient` AFTER INSERT ON `users` FOR EACH ROW BEGIN
  IF NEW.user_type = 'patient' THEN
    INSERT INTO PatientProfiles (user_id, first_name, last_name) VALUES (NEW.id, NEW.first_name, NEW.last_name);
  END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `after_user_insert_staff` AFTER INSERT ON `users` FOR EACH ROW BEGIN
  IF NEW.user_type = 'staff' THEN
    INSERT INTO StaffProfiles (user_id, first_name, last_name) VALUES (NEW.id, NEW.first_name, NEW.last_name);
  END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `after_user_profile_update` AFTER UPDATE ON `users` FOR EACH ROW BEGIN
  IF EXISTS (SELECT * FROM staffprofiles WHERE user_id = NEW.id)
THEN
  UPDATE staffprofiles SET first_name = NEW.first_name, last_name = NEW.last_name WHERE user_id = NEW.id;
  END IF;
   IF EXISTS (SELECT * FROM patientprofiles WHERE user_id = NEW.id)
THEN
  UPDATE patientprofiles SET first_name = NEW.first_name, last_name = NEW.last_name WHERE user_id = NEW.id;
  END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `after_user_update_to_admin` AFTER UPDATE ON `users` FOR EACH ROW BEGIN
  IF OLD.user_type != 'admin' AND NEW.user_type = 'admin' THEN
    DELETE FROM PatientProfiles WHERE user_id = NEW.id;
    DELETE FROM StaffProfiles WHERE user_id = NEW.id;
  END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `after_user_update_to_patient` AFTER UPDATE ON `users` FOR EACH ROW BEGIN
  IF OLD.user_type != 'patient' AND NEW.user_type = 'patient' THEN
    DELETE FROM StaffProfiles WHERE user_id = NEW.id;
    INSERT INTO PatientProfiles (user_id, first_name, last_name) VALUES (NEW.id, NEW.first_name, NEW.last_name);
  END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `after_user_update_to_staff` AFTER UPDATE ON `users` FOR EACH ROW BEGIN
  IF OLD.user_type != 'staff' AND NEW.user_type = 'staff' THEN
    DELETE FROM PatientProfiles WHERE user_id = NEW.id;
    INSERT INTO StaffProfiles (user_id, first_name, last_name) VALUES (NEW.id, NEW.first_name, NEW.last_name);
  END IF;
END
$$
DELIMITER ;

